import React, { useEffect, useState } from "react";
import {
    ResponsiveContainer,
    Bar,
    Treemap,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend
} from 'recharts';

const data = [
    {
        "name": "axis",
        "children": [
            {
                "name": "Axis",
                "size": 24593
            },
            {
                "name": "Axes",
                "size": 1302
            },
            {
                "name": "AxisGridLine",
                "size": 652
            },
            {
                "name": "AxisLabel",
                "size": 636
            },
            {
                "name": "CartesianAxes",
                "size": 6703
            }
        ]
    },
    {
        "name": "controls",
        "children": [
            {
                "name": "TooltipControl",
                "size": 8435
            },
            {
                "name": "SelectionControl",
                "size": 7862
            },
            {
                "name": "PanZoomControl",
                "size": 5222
            },
            {
                "name": "HoverControl",
                "size": 4896
            },
            {
                "name": "ControlList",
                "size": 4665
            },
            {
                "name": "ClickControl",
                "size": 3824
            },
            {
                "name": "ExpandControl",
                "size": 2832
            },
            {
                "name": "DragControl",
                "size": 2649
            },
            {
                "name": "AnchorControl",
                "size": 2138
            },
            {
                "name": "Control",
                "size": 1353
            },
            {
                "name": "IControl",
                "size": 763
            }
        ]
    }
]

const SymptomsTreemap = () => {

    /*const [data, setData] = useState([])

    useEffect(() => {
        setData(data)
    }, [])*/

    return (
            <ResponsiveContainer width={'100%'}>
                <Treemap
                    width={730}
                    height={250}
                    data={data}
                    dataKey="size"
                    ratio={4 / 3}
                    stroke="#fff"
                    fill="#8884d8"
                />
            </ResponsiveContainer>
    )

}

export default SymptomsTreemap;
